what-details-are-required-about-tv-broad.body:
As described in DBS-01, section 7.1.1, following information are required for the TV Broadcasting stations:

7.1.1 Information Required for TV Broadcasting Stations
A WSDB shall obtain the following information from Industry Canada's database for broadcasting stations to be protected from WSDs:

Transmitter coordinates (latitude/longitude);
Maximum ERP;
Height AGL of the radiating centre of the transmitting antenna;
Ground elevation AMSL
Horizontal transmit antenna pattern (if antenna is directional);
Channel numbers;
Station call sign; and
Station status.

what-information-are-required-for-rrbs-b.body:
As described in DBS-01, section 7.1.2, following information are required for the RRBS Base Stations:

7.1.2 Information Required for RRBS Base Stations
A WSDB shall obtain the following information from Industry Canada's database to help protect RRBS stations from WSDs:

Transmitter coordinates (latitude/longitude);
Maximum ERP;
Height AGL of the radiating centre of the transmitting antenna;
Site elevation AMSL;
Transmit antenna pattern (horizontal/vertical);
Channel numbers (both downstream (transmit) and upstream (receive) channels); and
Station call sign.

what-information-is-required-to-register.body:
7.2.2 TV Receive Site Registration and Cable TV Head-ends
A WSDB shall provide a registration process for TV receive sites that qualify for protection underSection 7.2.1.
A WSDB shall obtain the following registration information from TV receive-site users wishing to be protected from WSDs:

Names of the individuals or businesses responsible for each TV receive site;
Contact addresses;
Valid email addresses for contact persons;
Phone numbers for contact persons;
Coordinates of the location of the TV receive site;
Channels received at the TV receive site and their call signs; and
Call sign of the transmitter associated with the receive site or the cable operation number for cable TV head-ends.

The registrations shall be considered public.
A WSDB shall confirm that the TV receive site being registered is associated with an Industry Canada-authorized call sign.
A WSDB shall confirm that the TV receive site or cable TV head-end being registered resides no farther than 80 km outside the nearest edge of an associated protected contour.
If the information cannot be validated, the WSDB shall reject the registration of the TV receive site or the cable TV head-end, and return a message to contact Industry Canada for authorization.
Above information extracted from DBS-01 at http://www.ic.gc.ca/eic/site/smt-gst.nsf/eng/sf10928.html#s7.2.2
